import SettingsButton from './SettingsButton';

const red = '#f54e4e';

const green = '#4aec8c';

function Timer() {
    return (
    <div>
        <CircularProgressbar
        value={69} 
        text={`69%`}
        styles={buildStyles({
            textColor:'#fff',
            pathColor:red,
            tailColor:'rgba(255,255,255,.2)',

        })}/>
        <div style={{marginTop:'98px'}}>
            <PlayButton />
            <PauseButton />
            <div>
                <SettingsButton />
            </div>
        </div>
    </div>
    );

}

export default Timer;
